import React from 'react';
import {Link} from 'react-router-dom'
import { Menu } from 'antd' 
import 'antd/dist/antd'
import './App.css';

function App() {
  return (
    <div>
      <Menu mode="horizontal">
        <Menu.Item key="1">
          <Link to="">我的纸条</Link>          
        </Menu.Item>
        <Menu.Item key="2">
          <Link>抽个对象</Link>
        </Menu.Item>
        <Menu.Item key="3">
          <Link>摆摊赚钱</Link>
        </Menu.Item>
      </Menu>

    </div>
  )
}

export default App;
